    public static class Array extends VkStructureType implements cz.mg.collections.array.ReadonlyArray<VkStructureType> {
        private final int count;

        public Array(int count) {
            super(new VkMemory(count*VkStructureType.sizeof()));
            this.count = count;
        }

        public Array(int count, VkStructureType o){
            super(o.getVkMemory(), o.getVkAddress());
            this.count = count;
        }

        public Array(VkMemory vkmemory, int count) {
            super(vkmemory);
            this.count = count;
        }

        public Array(VkMemory vkmemory, long vkaddress, int count) {
            super(vkmemory, vkaddress);
            this.count = count;
        }



        public Array(int... values){
            this(values.length);
            for(int i = 0; i < values.length; i++) get(i).setValue(values[i]);
        }

        @Override
        public int count(){
            return count;
        }

        @Override
        public VkStructureType get(int i){
            return new VkStructureType(getVkMemory(), getVkAddress() + sizeof()*i);
        }
    }
